  [],\n\t\"revision_timestamp\": \"2015-05-07T03:45:01.259739\",\n\t\"name\": \"aircraft-electrical-power-system-diagnostics-and-health-management-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The objective of the project is the development
  of an open architecture, computational toolbox for design and implementation of
  diagnostic and prognostic algorithms for aircraft electrical power systems. The
  management of typical failure modes of the electrical system can have substantial
  returns in the overall availability, safety and operating cost of aircraft. We propose
  several innovative techniques for monitoring specific components of the power system
  such as generators, converters, and batteries. The integrated architecture using
  general purpose symbolic processing, numerical tools and data logging makes this
  project especially attractive and will bring advances in diagnostics and prognostics
  to engineering practice. The toolbox will include code generation tools resulting
  in the ability to seamlessly integrate the designed algorithms by automating several
  key steps for the implementation phase. In Phase I we will demonstrate the approach
  using experimental test beds. The successful completion of this phase of the project
  will provide not only a prototype health monitoring system but establish a framework
  to integrate new algorithms allowing the rapid packaging of advanced health management
  techniques for validation and verification, flight certification and final system
  integration and evaluation.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
